import React from 'react';

class User extends React.Component{
    render(){
        return(
            <div>
                <h3>{this.props.user.name}</h3>
                <p>{this.props.user.isCame ? "Присутствует" : "Отсутствует"}</p>
            </div>
        )
    }
}
export default User;
